INSERT INTO `vaccination` VALUES (1,'Rabies 1-year',25.00,'Core dog vaccine.Rabies is 100% fatal to dogs  with no treatment available. Prevention is key.'),(2,'Rabies 3-year',25.00,'Core dog vaccine.'),(3,'Distemper',35.00,'Core dog vaccine.Caused by an airborne virus  distemper is a severe disease that  among other problems  may cause permanent brain damage.'),(4,'Parvovirus',20.00,'Core dog vaccine.Canine parvo is contagious  and can cause severe vomiting and bloody diarrhea. Parvo is usually fatal if untreated.'),(5,'Adenovirus type 1 (CAV-1 canine hepatitis)',25.00,'Core dog vaccine.Spread via infected urine and feces; canine hepatitis can lead to severe liver damage  and death.'),(6,'Adenovirus type 2 (CAV-2 kennel cough)',25.00,'Core dog vaccine.Spread via coughs and sneezes.'),(7,'Parainfluenza',30.00,'Non-core dog vaccine.Parainfluenza infection (not the same as canine influenza) results in cough  fever. It may be associated with Bordetella infection.'),(8,'Bordetella bronchiseptica (kennel cough)',35.00,'Non-core dog vaccine.Not usually a serious condition  although it can be dangerous in young puppies. It is usually seen after activities like boarding or showing.'),(10,'Lyme disease',35.00,'Non-core dog vaccine.Generally recommended only for dogs with a high risk for exposure to Lyme disease-carrying ticks.'),(11,'Leptospirosis',35.00,'Non-core dog vaccine.Vaccination is generally restricted to established risk areas. Exposure to rodents and standing water can lead to a leptospirosis infection.'),(12,'Canine influenza',39.00,'Non-core dog vaccine.Similar to bordetella.'),(13,'Feline Distemper (Panleukopenia)',50.00,'Core cat vaccine.Feline distemper is a severe contagious disease that most commonly strikes kittens and can cause death.'),(14,'Feline Herpesvirus',20.00,'Core cat vaccine. Feline herpesvirus causes feline viral rhinotracheitis (FVR)  a very contagious upper respiratory condition.'),(15,'Calicivirus',15.00,'Core cat vaccine.A very contagious upper respiratory condition that can cause joint pain  oral ulcerations  fever  and anorexia.'),(16,'Feline Leukemia Virus (FeLV)',10.00,'Non-core cat vaccine.'),(17,'Bordetella',15.00,'A contagious upper respiratory condition.'),(18,'Rabies',40.00,'Core cat vaccine.Rabies is 100% fatal to cats  with no treatment available. Prevention is key.');
/*!40000 ALTER TABLE `vaccination` ENABLE KEYS */;
