CREATE DEFINER=`root`@`localhost` PROCEDURE `GetAnimalByCategoryGenderAndAgeGroup`(IN category varchar(5), gender char(1), age_group varchar(10))
BEGIN
 SELECT a.animal_id, a.animal_name, a.animal_image, a.animal_age_group, a.animal_weight, a.animal_color, a.is_neutered, a.is_children_friendly, a.animal_description, b.breed_name, ac.animal_category from animal a 
INNER JOIN animal_breed ab ON a.animal_id = ab.animal_id 
INNER JOIN Breed b ON ab.breed_id = b. breed_id
INNER JOIN Animal_Category ac ON ac.animal_category_id = a.animal_category_id
WHERE  ac.animal_category = category AND a.animal_gender = gender AND animal_age_group = age_group; 
 END ;;
